"    if (typeof window.HopperSDKBridge === 'undefined') {
        window.HopperSDKBridge = {
            event: function(eventName, data) {
                if (!data) {
                    data = {};
                }
                window.webkit.messageHandlers.HopperSDKBridge.postMessage({eventName: eventName, data: data});
            }
        };
    }

    window.onload = function() {
        document.body.addEventListener('click', function(event) {
            var targetElement = event.target;

            var backActionLink = targetElement.closest('a[data-action="back"]');
            if (backActionLink) {
                event.preventDefault();
                window.webkit.messageHandlers.backAction.postMessage(null);
            }

            var helpDiv = targetElement.closest('div.go-back-block');
            if (helpDiv) {
                event.preventDefault();
                window.webkit.messageHandlers.backAction.postMessage(null);
            }
        });
    };"
